- GDXReader:
    file: C:\projects\ntnu_iam_2024\model\energy_results.gdx
    symbols: 
      - name: COST_ANNUAL
      - name: ACT
      - name: CAP_NEW
      - name: EMISS
      - name: CUM_EMISS
      - name: TOTAL_COST
- Projection:
    name: COST_ANNUAL.all(0)
    newName: COST_ANNUAL_proj_(0)
- Projection:
    name: ACT.all(0,1)
    newName: ACT_proj_(0,1)
- Projection:
    name: CAP_NEW.all(0,1)
    newName: CAP_NEW_proj_(0,1)
- Projection:
    name: EMISS.all(0)
    newName: EMISS_proj_(0)
- Projection:
    name: CUM_EMISS.all
    newName: CUM_EMISS_proj_
- Projection:
    name: TOTAL_COST.all
    newName: TOTAL_COST_proj_
- ExcelWriter:
    file: C:\projects\ntnu_iam_2024\results\energy_results_export_v01_aviation_extention_limit_no.xlsx
    valueSubstitutions: {
      EPS: EPS,
      INF: INF,
      -INF: -INF,
      UNDEF: UNDEF,
      NA: NA
    }
    symbols:
      - name: COST_ANNUAL_proj_
        range: COST_ANNUAL!A1
        columnDimension: 1
      - name: ACT_proj_
        range: ACT!A1
        columnDimension: 1
      - name: CAP_NEW_proj_
        range: CAP_NEW!A1
        columnDimension: 1
      - name: EMISS_proj_
        range: EMISS!A1
        columnDimension: 1
      - name: CUM_EMISS_proj_
        range: CUM_EMISS!A1
        columnDimension: 1
      - name: TOTAL_COST_proj_
        range: TOTAL_COST!A1
        columnDimension: 1
